"""**JSON**

Такой формат файлов и данных, как JSON очень популярен в текущей разработке и используется на всех языках при разработке таких штук, как API.

JSON переводится, как JavaScript Object Notation. Да, нам стоит благодарить за этот прекрасный формат данных именно JavaScript.


По синтаксису данные хранятся там, как в словаре.
Сам формат данных является независимым и может использоваться всеми языками програмирования. Давайте разбираться что к чему.

![image.png](data:image/png;base64,)

`Json` написан на `JavaScript`, поэтому и типы в таком формате отличаются от типов Python. Когда говорим про хранение данных и работе с файлом, в первую очередь имеется в виду запись в файл и чтение из файла.

Для того, чтобы записать данные требуется перевести данные в формат `json`, а для того чтобы прочитать - перевести из формата `json`. Такой процесс называется `кодированием` и `декодированием`. А часть кода, которая эти действия выполняет называется `сериализатором` и `десериализатором`

`Сериализатор` – написанная инструкция, которая кодирует часть данных в определенный формат, для успешной отправки и декодирования.

`Десериализатор` - декодирует полученные данные для работы или хранения их.

Как собственно выглядят типы данных в JSON в сравнение с Python

![image.png](data:image/png;base64,)

Для работы с JSON файлами в питоне есть библиотека `json`. Она входит в стандартный набор файлов и модулей python, поэтому можно просто ввести её через `import`

**Чтение и запись данных**

Для того, чтобы записать данные в json используется метод `dump()`

Такие функции имеют много параметров, и знать все не
обязательно.

К функции `dump`, существует параметр `indent`, контролирующий отступы в файле; `sort_keys`, задающий сортировку ключам в файле. Про остальные можно почитать в документации.
"""

import json

some_data = {
    "name": "Jarred",
    "surname": "Austin",
    "age": 32,
    "sex": "male",
    "have_work": 1,
    "household_pet": {
        "type": "cat",
        "name": "Lucky",
        "age": 2,
        "color": "black"
    }
}


with open ("man_info.json", "w") as man_info:
  json.dump(some_data, man_info)

"""Для того, чтобы данные получить, есть метод `load()`"""

with open("man_info.json", "r") as data:
  res = json.load(data)

print(res)
print(type(res))

"""Если ваши json данные хранятся\приходят вам в формате строки, вы так же можете их обработать через методы `dumps()` и `loads()` соответственно.

* `dumps()` - Преобразует Python-объект в JSON-строку.
* `loads()` - Преобразует JSON-строку в Python-объекты.
"""

