"""# **CSV файлы**

Формат `.csv` – один из самых распространенных форматов для импорта и экспорта электронных таблиц. В большинстве случаев формат универсален. Однако для обработки данных есть некоторые различие форматирования. К примеру `csv` легко переводится в формат `.xls (.xlsx)`

Для того, чтобы записывать в файлы данные, можно использовать writer модуля `csv`.

`csv.writer` – это объект, который позволяет записывать данные в `csv` файл.

Данные передаются в виде двумерного списка, каждый список - это строка, каждый элемент - столбец таблицы. Далее создаем `writer` и с помощью его записываем данные в файл.
"""

import csv

films_list = [
    ["id", "name", "release", "genre", "length", "rating"],
    [1, "Superman", 2012, "Fantasy", "2:10", "16+"],
    [2, "Iron Man", 2008, "Fantasy, Shooter", "1:45", "16+"],
    [3, "Scream 6", 2023, "Horror", "1:52", "18+"],
]

with open("films.csv", "w") as data:
  writer = csv.writer(data)
  writer.writerows(films_list)

"""Для записи данных в `csv` файл, можно ещё использовать словари. Для этого необходимо создать список, в котором будут названия столбцов; далее создать словарь, в котором ключ - это название столбца, а значение - то, что записать в этот столбец.

Используем объект `csv.DictWriter`
"""

# The first way
with open("films_via_dict.csv", "w") as data:
  field_names = ["id", "name", "release", "genre", "length", "rating"]

  writer = csv.DictWriter(data, fieldnames=field_names)
  writer.writeheader() # запиши заголовки

  writer.writerow({"id": 1, "name": "Avangers", "release": 2012, "genre": "Fantasy", "length": "2:10", "rating": "16+"})
  writer.writerow({"id": 2, "name": "Avangers2", "release": 2016, "genre": "Fantasy", "length": "2:30", "rating": "16+"})
  writer.writerow({"id": 3, "name": "Avangers3", "release": 2020, "genre": "Fantasy", "length": "2:45", "rating": "18+"})
  writer.writerow({"id": 4, "name": "Avangers4", "release": 2022, "genre": "Fantasy", "length": "3:15", "rating": "18+"})

